import { BrowserRouter, Routes, Route } from 'react-router-dom';
import Dashboard from './pages/Dashboard';

function App() {
	return (
		<div>
			<BrowserRouter>
				<Routes>
					<Route path="/dashboard" element={<Dashboard />}></Route>
				</Routes>
			</BrowserRouter>
		</div>
	);
}

export default App;
